using System.Windows.Media;

namespace SylphyHorn.Interop
{
	using static NativeMethods;

	internal static class ImmersiveColorHelper
	{
		internal static Color GetColorByTypeName(string name)
		{
			var colorSet = GetImmersiveUserColorSetPreference(false, false);
			var colorType = GetImmersiveColorTypeFromName(name);
			var rawColor = GetImmersiveColorFromColorSetEx(colorSet, colorType, false, 0);
			return FromAbgr(rawColor);
		}

		private static Color FromAbgr(uint abgrValue)
		{
			var a = (byte)((0xFF000000 & abgrValue) >> 24);
			var b = (byte)((0x00FF0000 & abgrValue) >> 16);
			var g = (byte)((0x0000FF00 & abgrValue) >> 8);
			var r = (byte)(0x000000FF & abgrValue);
			return Color.FromArgb(a, r, g, b);
		}
	}

